import React, { useState, useCallback } from 'react';
import Index from '.';

const Hello = () => {
    const [count, setCount] = useState(0);

    const increament = useCallback(() => {
        setCount(c => c + 1);
    }, [count, setCount])

    return (
        <>
            <Index increament={increament} />
            <div>
                Count ==>  {count}
            </div>
        </>
    )
}

export default Hello;
